                    sp = sp[1].split('&')
                    for (let j = 0; j < sp.length; j++) {

                    }
                    if (result) {

                }
            }
            return result

            var sp = document.cookie.split(';')
            var result = []

                if (sp2.length > 1) {

                    }
                }
            }
